  <body>
    <script>

        var selectFloor = 1
        var floormapChange = function() {
            selectFloor = $("#floorSelect").val();
            $("#floorLevel").val(selectFloor);
            $('#download').prop('download', "grid_Data"+selectFloor+"F.txt")

            var elem = document.getElementById("floormap");
            elem.src = "/map" + selectFloor + "F.png";
        }
        //DIVタグエリアの色設定
        var clipboadCopy = function(tr_num, td_num){
            id = tr_num +'_'+ td_num;
            var elem = document.getElementById(id);

            var style = elem.style;

            if(style.backgroundColor == 'black') {
                style.backgroundColor = 'transparent';
            }
            else {
                style.backgroundColor = 'black';
            }
        }

        //グリッドデータをダウンロード
        //1 => 通れない/ 0 => 通れる
        var gridDataDownload = function() {
            var aryGrid = [];

            //グリッドのデータ抽出
            for(var row = 0; row < 100; row++) {
                var aryCol = [];

                for(var col = 0; col < 100; col++) {

                    var id = col + "_" + row;
                    var elem = document.getElementById(id);
                    var style = elem.style;

                    if(style.backgroundColor == "black") {
                        aryCol[col] = 0;
                    }
                    else {
                        aryCol[col] = 1;
                    }
                }
                aryGrid[row] = aryCol.join(",");
            }

            var grid = "";
            for(var i = 0, len = aryGrid.length; i < len; i++) {
                grid += "[" + aryGrid[i] + "],\n";
            }

            //抽出データをファイルに保存
            var blob = new Blob([grid], {"type" : "text/plain"});

            if(window.navigator.msSaveBlob) {
                window.navigator.msSaveBlob(blob, "grid_Data"+selectFloor+"F.txt");
            }
            else {
                document.getElementById("download").href = window.URL.createObjectURL(blob);
            }
        }

        //グリッドデータをアップロード
        var upFile;
        function gridDataUploadInit() {
            upFile = document.getElementById("upload");
            upFile.addEventListener("change", uploadFileRead);
        }

        function uploadFileRead(e) {
            var reader = new FileReader();
            reader.readAsText(e.target.files[0]);

            reader.addEventListener("load", function() {
                var aryData = reader.result.split("\n");    //1行ずつ分割し配列に格納

                for(var col = 0, len = aryData.length; col < len; col++) {
                    // [ と ],　を削除
                    aryData[col] = aryData[col].replace("[", "");
                    aryData[col] = aryData[col].replace("],", "");

                    // , 区切りを分割し配列に格納
                    var aryRow = aryData[col].split(",");
                    for(var row = 0, len = aryRow.length; row < len; row++) {
                        var color = aryRow[row];

                        var id = row + "_" + col;
                        var elem = document.getElementById(id);
                        var style = elem.style;

                        if(color == 0) {
                            style.backgroundColor = 'black';
                        }
                        else {
                            style.backgroundColor = 'transparent';
                        }
                    }
                }

            });
        }

      //alert(tr_num + ',' + td_num)
      // elem.select();
      // document.execCommand("copy");

</script>
